1. Psychological mechanisms  
   - Responder cares about absolute gain (how much they get).  
   - Responder also cares about fairness relative to what they “deserve” given their contribution.  

2. Interaction  
   - More money increases willingness to accept.  
   - Larger deviation from deserved share decreases willingness.

3. Mathematical form  
   - Linear combination of (a) share‐of‐pot for self and (b) deviation from deserved share.  
   - Convert utility to choice by a logistic.

4. Parameters  
   - intercept (baseline bias).  
   - weight_gain ≥ 0 on share_self_frac.  
   - weight_fairness ≥ 0 on inequity.  

5. Observable mapping  
   - share_self_frac = split_self/combined_earning  
   - expected_frac = token_self/(token_self+token_opp)  
